    false,nt"url": null,nt"notes": "This narrative report for Erie National
    Wildlife Refuge outlines Refuge accomplishments for the 1980 calendar year. The
    report begins by giving a brief introduction to the Refuge and describing the climate
    and habitat conditions in the Refuge, as well as funding, systems status, and Refuge
    staff. The construction and maintenance section describes recent construction, maintenance,
    and wildfires. The habitat management section discusses croplands, wetlands, forestlands,
    grasslands, and wilderness and special areas. Wildlife- including endangered and
    threatened species, migratory birds, big game animals, and raptors- are discussed.
    The public relations sections describes information and interpretation, recreational
    uses, and enforcement. Field investigations, cooperative programs, items of interest,
    and safety are discussed. Photographs are attached.",nt"license_title": "License
